    constructor() {
    super();
    this.state = { 
            user: null,
            email: null,
            name: null,
            password: null,
            confirmPassword: null
        }
        this.handleSubmit = this.handleSubmit.bind(this);
    }

render() {
  return (
    <div className="App">
    <Nav user={this.state.user}/>
    <header className="App-header">
    <HomePage />
    </header>
    </div>
  );
}
}
export default App;
